              display_text:
                'Make the overnight spiced vodka: In a glass jar, combine the vodka, cinnamon stick, star anise pod, and cloves. Seal the jar tightly and give it a quick shake, then let infuse at room temperature for at least 24 hours, or up to 3 months. Strain out the whole spices before using.',
              position: 1,
              start_time: 79000,
